            ["Entry_63"] = { "may your troubles|be many", "不幸多き|人生であれ", "네 골칫거리는|한둘이 아닐 것이다", "愿你麻烦缠身", "пусть проблемы|твои|приумножаться", "mögest du viele|Probleme haben", "que tus problemas|abunden", "que ton chemin soit|plein de bombes", },
